floor = 0
counter = 0

puzzle.each_char do |c|
  if c == "("
    floor = floor + 1

  elsif c == ")"
    floor = floor - 1
  end
  counter += 1

  if floor == -1
    puts "Character #{counter} led to basement"
  end
end

puts "Santa has to go to floor #{floor}"
